import "../App.css";
import React, { useEffect, useState } from "react";

function Loading() {
  const delay = 2000;
  const [loadingVisible, setLoadingVisible] = useState(true);

  useEffect(() => {
    setTimeout(() => {
      setLoadingVisible(false);
    }, delay);
  }, []);

  return loadingVisible ? (
    <div className="Loading">
      <span>L</span>
      <span>o</span>
      <span>a</span>
      <span>d</span>
      <span>i</span>
      <span>n</span>
      <span>g</span>
      <span>.</span>
      <span>.</span>
      <span>.</span>
    </div>
  ) : (
    <div></div>
  );
}

export default Loading;
